WIN32ERROR_LOOKUP: dict[int, ThirtyTwoBits] = dict()

def cached_win32error(code: int, name: str) -> ThirtyTwoBits:
    if code in WIN32ERROR_LOOKUP:
        return WIN32ERROR_LOOKUP[code]

    bits = ThirtyTwoBits(code, name)
    WIN32ERROR_LOOKUP[code] = bits
    return bits

